var render = function render(){var _vm=this,_c=_vm._self._c;return _c('ContentSlotsDistributor',{attrs:{"slot-key":_vm.$parent.slotKey}},[_c('h1',{attrs:{"id":"人工智能-x-密码的核心框架"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#人工智能-x-密码的核心框架"}},[_vm._v("#")]),_vm._v(" 人工智能 x 密码的核心框架")]),_vm._v(" "),_c('p',[_vm._v("在本节中，我们将讨论人工智能 x Crypto 领域的导航框架。我们将从两个人工智能 x Crypto 项目的案例研究开始。在分析这些项目之后，我们将讨论一般原则。")]),_vm._v(" "),_c('h2',{attrs:{"id":"_2-1-介绍性案例、研究"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#_2-1-介绍性案例、研究"}},[_vm._v("#")]),_vm._v(" 2-1 介绍性案例、研究")]),_vm._v(" "),_c('h3',{attrs:{"id":"案例研究-privasea"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#案例研究-privasea"}},[_vm._v("#")]),_vm._v(" 案例研究：Privasea")]),_vm._v(" "),_c('blockquote',[_c('p',[_vm._v("Privasea 是一家公司，其使命是让人工智能模型的训练方式能够保护每个人的数据隐私。他们使用一种名为全同态加密（FHE）的方法。这样就能在加密数据上使用人工智能模型。例如，当用户当前提示 ChatGPT 时，该提示会被发送到 OpenAI 服务器。OpenAI 可以看到该提示，并将其反馈给模型和返回输出。通过 FHE，您可以创建一个接受 \"加密提示 \"的 ChatGPT 版本。因此，当我提示 ChatGPT 时，OpenAI 永远不会看到我的实际提示，只会看到其加密版本。这在个人隐私方面也有用武之地。此外，这对大型企业也至关重要。对冲基金不允许员工使用 ChatGPT。")])]),_vm._v(" "),_c('p',[_vm._v("在这个例子中，加密技术正在帮助改进人工智能产品。具体来说，一种加密方法被用来改变人工智能堆栈（人工智能模型的训练方式）。这就产生了新的功能：一个可以接受加密提示的模型。因此，由于采用了加密工具，人工智能的可能性空间现在更大了。如下图所示。")]),_vm._v(" "),_c('p',[_c('img',{attrs:{"src":"/assets/20240219135148.png#pic_center","alt":"图一"}})]),_vm._v(" "),_c('p',[_vm._v("如上图所示，使用加密技术对人工智能堆栈进行内部更改，可产生新的功能。例如，FHE 允许我们使用加密提示。")]),_vm._v(" "),_c('h3',{attrs:{"id":"案例研究-多尔萨"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#案例研究-多尔萨"}},[_vm._v("#")]),_vm._v(" 案例研究：多尔萨")]),_vm._v(" "),_c('blockquote',[_c('p',[_vm._v("Dorsa 是一家区块链安全初创公司。他们使用人工智能模型来审核和监控智能合约。他们开发了各种工具，包括强化学习代理，以广泛测试智能合约的安全性。Dorsa 开发的工具可以帮助开发人员和审计人员。因此，Dorsa 正在利用人工智能模型来提高智能合约的安全性和可靠性。")])]),_vm._v(" "),_c('p',[_vm._v("在上面的例子中，人工智能正在帮助改进一种加密产品。具体来说，链外人工智能模型被用来使创建安全智能合约的过程更快、更便宜。这种人工智能还可能发现传统方法无法发现的漏洞，从而防止未来的黑客攻击。请注意，人工智能并不会带来新的能力。编写安全的智能合约总是可能的。人工智能的作用是使这一过程更快、更便宜。")]),_vm._v(" "),_c('p',[_vm._v("现在，让我们先看最后一个案例，然后再讨论一般原则。")]),_vm._v(" "),_c('h3',{attrs:{"id":"案例研究-lovergpt"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#案例研究-lovergpt"}},[_vm._v("#")]),_vm._v(" 案例研究 LoverGPT")]),_vm._v(" "),_c('blockquote',[_c('p',[_vm._v("LoverGPT 是一款 Web2 AI 女朋友应用程序。他们不审查露骨的聊天内容或图片，因此可能会面临维萨卡和万事达卡的问题（类似于这家公司被审查）。为了解决这个问题，他们接受加密货币支付。产品的其他部分没有使用区块链。")])]),_vm._v(" "),_c('blockquote',[_c('p',[_vm._v("这是人工智能 x 加密货币吗？从技术上讲，有一个人工智能组件（聊天机器人）和一个加密货币组件（加密货币支付）。但是，这两者之间并不存在有意义的互动。如果这家公司销售大麻并接受加密货币支付，那也不会有什么不同。加密货币为那些可能受到人工智能和加密货币的结合往往流于表面，没有实际价值。")])]),_vm._v(" "),_c('p',[_vm._v("上面的例子展示了一个包含加密和人工智能组件的产品。虽然这是一个加密货币用例，但它并不是一个人工智能 x 加密货币项目。人工智能和加密技术可以是相互支持的技术。人工智能可以帮助改进加密堆栈，而加密也可以帮助改进人工智能堆栈。Privasea（FHE-ML）和 Dorsa（智能合约安全的人工智能模型）的例子就说明了这一点。不过，在 LoverGPT 的例子中，加密技术和人工智能只是共存而已。")]),_vm._v(" "),_c('p',[_vm._v("加密技术和人工智能是相辅相成的技术。每种技术都能相互促进。实现这一潜力的项目被归类为 AI x Crypto 项目。可以通过本节提供的框架来了解和评估这些项目。")]),_vm._v(" "),_c('p',[_c('img',{attrs:{"src":"/assets/20240219131209.png#pic_center","alt":"图二"}})]),_vm._v(" "),_c('p',[_vm._v("人工智能和加密货币在产品中互动的三种方式示意图。")]),_vm._v(" "),_c('p',[_vm._v("注：加密货币是一个广义的术语。维塔利克在讨论人工智能和加密货币时提到 \"强大的加密货币形式不仅包括区块链扩展解决方案，还包括 ZKPs 和 FHE\"。在本文中，我们将使用加密货币作为这些技术的总称。必要时，我们会说明我们指的是代币、加密技术还是区块链扩展解决方案。")]),_vm._v(" "),_c('h2',{attrs:{"id":"_2-2-人工智能与加密货币互相帮助"}},[_c('a',{staticClass:"header-anchor",attrs:{"href":"#_2-2-人工智能与加密货币互相帮助"}},[_vm._v("#")]),_vm._v(" 2.2 人工智能与加密货币互相帮助")]),_vm._v(" "),_c('p',[_vm._v("回顾上面的两个例子。在 Privasea 中，FHE（一种加密方法）被用来创建能够保护用户数据隐私的人工智能模型。密码学原理被用来改进人工智能堆栈（模型的训练方法），因此密码学正在帮助人工智能。")]),_vm._v(" "),_c('p',[_vm._v("与此同时，在 Dorsa，一个人工智能模型正被用于确保智能合约的安全。在这里，人工智能工具被用来改进加密堆栈的一个方面（开发安全的智能合约）。因此，人工智能正在帮助加密货币。")]),_vm._v(" "),_c('p',[_vm._v("在评估人工智能与加密货币交叉项目时，这就给我们带来了一个重要的区别：加密货币是用来帮助人工智能的？还是人工智能被用来帮助加密货币？")]),_vm._v(" "),_c('p',[_vm._v("这个简单的问题可以帮助我们发现当前用例的一个重要方面。这里要解决的关键问题是什么？在 Dorsa 的案例中，我们希望得到的结果是一份安全的智能合约。这可以由熟练的人工来开发，但 Dorsa 借助人工智能使这一过程更加高效。不过，从根本上说，我们只关心安全的智能合约。一旦明确了关键问题，我们就能确定是人工智能在帮助加密货币，还是加密货币在帮助人工智能。在某些情况下，两者之间并不存在有意义的互动（例如 LoverGPT）。")]),_vm._v(" "),_c('p',[_vm._v("下表提供了每个类别中的几个例子。")]),_vm._v(" "),_c(